<html lang="en">

<head>
    <title>AdPushup Open Source</title>
    <meta charset="utf-8">
    <meta content="width=device-width,initial-scale=1" name=viewport>
    <link href="https://fonts.googleapis.com/css?family=Open+Sans:300,600" rel="stylesheet">
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/3.3.7/css/bootstrap.min.css">
    <style>
        html,
        body {
            font-family: 'Open Sans', sans-serif;
            overflow-x: hidden !important;
        }

        .logo {
            width: 300px;
            height: auto;
        }

        .jumbotron {
            background-color: #000;
            margin-bottom: 0;
        }

        h2 {
            font-weight: 300;
            font-size: 1.65em;
            margin-top: 15px;
            color: #eee;
        }

        .attribution {
            background-color: #000;
            color: #fff;
            padding: 20px;
        }

        .list {
            background-color: #2a2a2a;
            padding: 30px 0 100px;
        }

        .item {
            background-color: #1a1a1a;
            padding: 10px;
            border-radius: 3px;
            box-shadow: 1px 2px 2px rgba(0,0,0,.25);
        }

        .item > a:hover {
            text-decoration: none;
        }

        .item img {
            width: 150px;
            height: auto;
        }

        .item h3,
        .item p {
            color: #fff;
        }

        .item h3 {
            font-weight: 600;
            margin-top: 10px;
        }

        .item p {
            margin-top: 10px;
            font-weight: 300;
            line-height: 1.6em;
        }

        .btn-view {
            background-color: rgba(0,0,0,.25);
            color: #fff;
            padding: 8px 35px;
            border: 1px solid #fff;
            border-radius: 3px;
            margin-top: 10px;
            margin-bottom: 10px;
        }
    </style>
</head>
